-- movie: 500개의 영화 데이터
-- theater: 20개의 상영관 데이터
-- seat: 각 상영관 5x5, 총 500개 좌석 데이터
-- screening: 500개의 영화당 3회 상영, 총 1500개 상영 데이터


-- contentRating 축약값으로 DB 저장
-- 'ALL'을 'A'로 변환
UPDATE movie
SET content_rating = 'A'
WHERE content_rating = 'ALL';

-- 'TWELVE'을 'B'로 변환
UPDATE movie
SET content_rating = 'B'
WHERE content_rating = 'TWELVE';

-- 'FIFTEEN'을 'C'로 변환
UPDATE movie
SET content_rating = 'C'
WHERE content_rating = 'FIFTEEN';

-- 'ADULT'을 'D'로 변환
UPDATE movie
SET content_rating = 'D'
WHERE content_rating = 'ADULT';
